import React from 'react';
import './App.css';

const Header: React.FC = () => {
  return (
    <div className="Header">HOME</div>
  )
}

const App: React.FC = () => {
  const message: string = "こんちは";
  return (
    <div className="App">
      <Header />
      <p>はろー</p>
      <p>{ message }</p>
    </div>
  );
}

export default App;
